import React from 'react';
import "./App.css"
import redHeart from "./icons/red_heart.png";

class HeartIcon extends React.Component {

    constructor(props){
        super(props);
    }


    render() {
        return  (
            <div className="redHeart">
                <img src={redHeart} className="Heart" alt="red_heart" />
            </div>
        );
    }
}

export default HeartIcon;
